import React from 'react'; 
import './Square.css';
import Piece from '../Piece/Piece';






const Square = ({row, column, background, piece}) => {
	let classes = 'square '+background;
	let position = [column, row];
	let returnThis = piece 
	? <div className={classes} data-row={row} data-column={column}> <Piece position={position} type={piece} /> </div>
	: <div className={classes} data-row={row} data-column={column} />;
	return returnThis; 
}

export default Square;
